import React from "react";
import avatar from "../../images/mheader.png";
function Userlist({ img, title, update, cname, cactive, button }) {
  return (
    <li>
      <div><img src={avatar} alt="avatarka" /><h1>
      Contact Email not Linked <span>Updated 1 day ago</span></h1> </div>
    </li>
  );
}

export default Userlist;
